import RightBar from "./RightBar";


const Feed = () => {
  return (
    <div className="flex-none text-white border-l border-r border-gray-700 h-full w-[600px]">
      <FeedHeader />
      <TweetForm />
      <TweetPost image={lg} />
      <TweetPost image={lg2} />
      <div>
      <RightBar/>
      </div>
    </div>
  );
};

export default Feed;
